import React from 'react';
import './Header.css';

const Header = () => {
  return (
    <header className="header">
      <div className="header-left">
        <button className="header-button">Left Button</button>
      </div>
      <div className="header-right">
        <button className="header-button">Right Button 1</button>
        <button className="header-button">Right Button 2</button>
      </div>
    </header>
  );
};

export default Header;
